gmd:dataQualityInfo.gmd:DQ_DataQuality.gmd:lineage.gmd:LI_Lineage.gmd:statement.gco:CharacterString.#text:§Données tabulaires collectées sur différents sites (DGFiP et DGCL) et mises en forme pour les besoins de l'étude.
Ces données portent sur le potentiel fiscal et la dotation globale de fonctionnement des 325 communes pour chacune des quatre années :
- Dotation globale de fonctionnement de la commune en millions d'euros ;
- Dotation globale de fonctionnement par habitant (en euros) ;
- Dotation globale de fonctionnement de la strate de la commune concernée ;
- Potentiel foscal de la commune en millions d'euros ;
- Potentiel fiscal par habitant de la commune (en euros) ;
- Potentiel fiscal de la strate de la commune concernée.

